import React, { useState, useEffect } from 'react';
import './App.css';
import MyComp from './components/myComp';
import MyLoader from './components/myLoader';
function App() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  useEffect(() => {
    setTimeout(() => {
      setData([
        {
          id: 0,
          logo:
            'data:image/jpeg;base64,',
          title: 'peaky',
          type: 0,
        },
        {
          id: 1,
          logo:
            'data:image/jpeg;base64,',
          title: 'peaky blinders2',
          type: 1,
        },
        {
          id: 2,
          logo:
            'data:image/jpeg;base64,',
          title: 'clian Murphy',
          type: 0,
        },
        {
          id: 3,
          logo:
            'data:image/jpeg;base64,',
          title: 'hi there',
          type: 0,
        },
        {
          id: 4,
          logo:
            'data:image/jpeg;base64,',
          title: 'hello',
          type: 1,
        },
      ]);
      setLoading(false);
    }, 5000);
  }, []);
  return (
    <div className='App'>
      <div style={{ width: 650, padding: 20 }}>
        {loading ? (
          <>
            <MyLoader />
            <MyLoader />
            <MyLoader />
            <MyLoader />
            <MyLoader />
          </>
        ) : (
          data.map((item) => (
            <MyComp
              title={item.title}
              type={item.type}
              key={item.id}
              src={item.logo}
            />
          ))
        )}
      </div>
    </div>
  );
}

export default App;
